import React from 'react';
import 'boxicons'

const Alarm = () => {
    return (
        <div className='container w-1/2 h-auto min-h-96 bg-slate-800 rounded-md flex flex-col justify-center items-center p-5'>
            <div className='text-white font-bold text-4xl'>23:53:04</div>
            <div className='inputs mt-5'>
                <input type='number' className='mr-7' placeholder='00' min={0} max={23}></input>
                <input type='number' placeholder='00' min={0} max={59}></input>
            </div>
            <div className='buttons w-2/3'>
                <button type='number' className='mr-2' placeholder='00' min={0} max={23}>Add</button>
                <button type='number' placeholder='00' min={0} max={59}>Clear</button>
            </div>

            <div className='flex justify-between w-full'>
                
                    <span className='text-white text-xl'>00:00</span>
                    <div className='flex gap-5'>
                        <box-icon name='toggle-left'></box-icon>
                        <box-icon type='solid' name='trash-alt'></box-icon>
                    </div>
                
            </div>
            
            
            
            <box-icon name='toggle-right' type='solid' color='#ffffff' ></box-icon>

        </div>
    );
};

export default Alarm;
